import * as React from "react";
import Box from "@mui/material/Box";
import TextField from "@mui/material/TextField";
import Button from "@mui/material/Button";
import FormGroup from "@mui/material/FormGroup";
import FormControlLabel from "@mui/material/FormControlLabel";
import Checkbox from "@mui/material/Checkbox";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      pageNumbers: 10,
      page: 1,
      form: { searchText: "", is2b2b: false, isSecure: false },
    };
  }

  onTextFieldChange = (e) => {
    this.setState({ form: { ...this.state.form, searchText: e.target.value } });
  };

  submitClicked = () => {};

  render() {
    const { is2b2b, isSecure } = this.state.form;
    return (
      <Box
        component="form"
        sx={{
          display: "flex",
          flexDirection: "row",
          justifyContent: "space-around",
        }}
        noValidate
        autoComplete="off"
      >
        <TextField
          onChange={(e) => {
            this.onTextFieldChange(e);
          }}
          value={this.state.form.searchText}
          id="outlined-basic"
          label="Search Here"
          variant="outlined"
        />
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2b2b"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2b2b"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2b2b"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
        <FormGroup>
          <FormControlLabel
            control={<Checkbox checked={is2b2b} />}
            label="2b2b"
          />
          <FormControlLabel
            control={<Checkbox checked={isSecure} />}
            label="secure"
          />
        </FormGroup>
      </Box>
    );
  }
}

export default Form;
